ديديه #دروغبا ينفي خبر إعتناقه دين الإسلام.
#الديربي
@didierdrogba https://t.co/0UtzoKp7eH

@Nawaf_STATS دروغبا يوضح حقيقة اعتناقه الإسلام في تغريدة على حسابه الرسمي :

القصة انتشرت بسرعة، لكنني لم أغير "الديانة".
كان هذا مجرد احترام لإخواني المسلمين، خلال زيارتي لهم في قريتي.

الأسطورة الايفواري #ديديه_دروجبا ينفي خبر اعتناقه الإسلام 🌙
ويؤكد عبر حسابه في تويتر أن ..الصور التي انتشرت له كانت مجرد احترام لأصدقائه المسلمين خلال زيارته لقريته ♥️
@didierdrogba https://t.co/GRLU6L77es

@vivalalgerie7 🔸️ دروغبا عن خبر إعتناقه الإسلام : " هذه القصة تنتشر بسرعة . لكنني لم أغير الدين ، كان هذا مجرد احترام لإخواني المسلمين الذين كنت أزورهم في قريتي. الكثير من الحب والبركات للجميع " 

[ TW ]

و نعتذر بدورنا عن نشر خبر إسلامه 🙏

